const Room = ({ room }) => {
  return (
    <div
      className={`w-12 h-12 flex items-center justify-center rounded-md font-semibold shadow-sm transition-all duration-300 ${
        room.occupied
          ? 'bg-red-500 text-white'
          : 'bg-green-400 text-white hover:scale-105 cursor-pointer'
      }`}
    >
      {room.number}
    </div>
  );
};

export default Room;
